INSERT INTO `minif_posts` (`id`, `title`, `title_uri`, `posts`, `image`, `thumbnail`, `author`, `created`) VALUES
(1, 'This is My first posts!', 'This-is-My-first-posts!', '<p>Hey there, Assalamualaikum, may peace be upon you. Thanks for using minif. this project developed for learning PHP Classes by using mini framework model. Finnaly, I hope you enjoy your experience with minif.</p><p>Thank you.</p> tes    ', 'minif.jpg', 'thumb_minif.jpg', 'minif_admin', '2018-04-28 12:56:22'),
(2, 'Imam Kurniawan adalah namaku', 'Imam-Kurniawan-adalah-namaku', 'coba posting berita. Know how to build websites? Then you already know how to build mobile apps. Ionic Framework offers the best web and native app components for building highly interactive native and progressive web apps.', NULL, NULL, NULL, '2017-10-07 00:40:23'),
(3, 'Jangan pernah menyerah untuk mencoba', 'Jangan-pernah-menyerah-untuk-mencoba', 'Saya adalah seorang yang suka belajar sesuatu yang bermanfaat. Alhamdulillah banyak manfaat yang saya dapatkan dalam hal ini.', NULL, NULL, NULL, '2018-04-30 02:09:46'),
(5, 'Membangun log system page visitor', 'Membangun-log-system-page-visitor', 'Kali ini kita akan mencoba untuk membangun sebuah sistem untuk menyimpan data visitor yang mengunjungi <b>website kita</b>.  ', NULL, NULL, NULL, '2017-10-08 23:06:01'),
(7, 'My sons Adams', 'My-sons-Adams', 'Hi, my name is Adam and This is my blog. I really love writing, especially about my adventure jurney.. follow me in twitter and facebook. ', NULL, NULL, NULL, '2018-04-29 03:29:20'),
(8, 'Coba posting Berita', 'Coba-posting-Berita', 'Hello world..  ', NULL, NULL, NULL, '2018-04-30 04:44:24'),
